import { apiRequest } from "./util";

export function getSheet(sheetLink) {
    const sheetID = sheetLink.substring(sheetLink.lastIndexOf('/d/') + 3, sheetLink.lastIndexOf('/edit#'));
    // Create responses request
    console.log(sheetID);
    apiRequest("getSheet", "GET", {
        sheetID: sheetID
    });
}
